// Input add list
var gene_lists = new Object();
$("#add_list").click(function() {
  
  let rnd_str = Math.random().toString(36).substring(2,6) + Math.random().toString(36).substring(2,6);
  let list_name = $( "input[type=text][name=list_name]" ).val()
  $( "input[type=text][name=list_name]" ).val("")
  let gene_list = $("#gene_list").val()
  if (list_name.length == 0){
    alert("Please type list name!")
    return true;
  }
  if (gene_list.length == 0){
    alert("Please type gene list!")
    return true;
  }


  $("#gene_list").val("")
  $("#list_result").append('<span id="'+rnd_str+'_parent"><a href="#" onClick="return false;"><i class="fas fa-trash-alt" id="'+rnd_str+'"></i></a> '+list_name+'<p></span>');
  gene_lists[list_name] = gene_list;
  $("#"+rnd_str).click(function() {
    $("#"+rnd_str+"_parent").remove();
    delete gene_lists[list_name]; 
  });
});

$("#clear_lists").click(function() {
  gene_lists = new Object();
  $("#list_result").html('');
});

